import CustomButton from "./customButton";

function User(props) {
  return (
    <div className="user-card">
      <div>{props.user.age}살 - </div>
      <div>{props.user.name}</div>
      {/* //2. 버튼을 컴포넌트로 바꾸기 */}
      <CustomButton
        onClick={() => {
          props.handleDelete(props.user.id);
        }}
      >
        삭제하기
      </CustomButton>
    </div>
  );
}
export default User;
